import React from 'react';
import ReactAnimatedWeather from 'react-animated-weather';

const defaults = {
    icon: 'CLEAR_DAY',
    color: 'goldenrod',
    size: 100,
    animate: true
};

function WeatherInfo() {
    return (
        <React.Fragment>
            <ReactAnimatedWeather
                icon={defaults.icon}
                color={defaults.color}
                size={defaults.size}
                animate={defaults.animate}
            />
        </React.Fragment>
    );
}

export default WeatherInfo;
